import { login } from '@/api/wiki';
import { setToken } from '@/libs/util';
export default {
  data: function data() {
    return {
      form: {
        username: '',
        password: ''
      },
      rules: {
        username: [{
          required: true,
          message: 'AppId不能为空',
          trigger: 'blur'
        }],
        password: [{
          required: true,
          message: 'AppSecret不能为空',
          trigger: 'blur'
        }]
      },
      loading: false
    };
  },
  methods: {
    handleSubmit: function handleSubmit() {
      var vm = this;
      this.$refs['loginForm'].validate(function (valid) {
        if (valid) {
          vm.loading = true;
          login(vm.form).then(function (response) {
            vm.$Message.success(response.data.msg);
            setToken(response.data.data.apiAuth);
            sessionStorage.setItem('ApiAdmin_AppInfo', response.data.data.app_id);
            vm.$router.push({
              name: 'wiki_list'
            });
            vm.loading = false;
          }).catch(function () {
            vm.loading = false;
          });
        }
      });
    }
  }
};
